INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (2, 130011, 0.0, 100, 1, 3001100, 3001, "2030/01/01 14:59:59", "2024/10/31 12:00:00", -416.5, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", 2.1, "ヤマト");
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (2, 130011, 0.0, 101, 4, 3001101, 3001, "2030/01/01 14:59:59", "2024/10/31 12:00:00", -416.5, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", 5.68, "ヤマト");
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (1, 130011, 0.0, 102, 1, 3001102, 3001, "2030/01/01 14:59:59", "2024/10/31 12:00:00", -416.5, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", 0.0, "ヤマト");
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (1, 130211, 0.0, 100, 1, 3002100, 3002, "2030/01/01 14:59:59", "2024/10/31 12:00:00", -416.5, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", 0.0, "フブキ");
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (1, 130211, 0.0, 101, 1, 3002101, 3002, "2030/01/01 14:59:59", "2024/10/31 12:00:00", -416.5, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", 0.0, "フブキ");
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (2, 130211, 0.0, 102, 5, 3002102, 3002, "2030/01/01 14:59:59", "2024/10/31 12:00:00", -416.5, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", 8.53, "フブキ");
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (1, 130211, 0.0, 103, 7, 3002103, 3002, "2030/01/01 14:59:59", "2024/10/31 12:00:00", -416.5, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", 5.67, "フブキ");
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (1, 130211, 0.0, 104, 1, 3002104, 3002, "2030/01/01 14:59:59", "2024/10/31 12:00:00", -416.5, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", 0.0, "フブキ");
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (3, 130211, 0.0, 300, 3, 3002300, 3004, "2030/01/01 14:59:59", "2024/10/31 12:00:00", -416.5, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", 0.0, "フブキ");
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (7, 130211, 0.0, 301, 7, 3002400, 3005, "2030/01/01 14:59:59", "2024/10/31 12:00:00", -416.5, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", 0.0, "フブキ");
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (1, 130211, 0.0, 200, 2, 3003200, 3003, "2030/01/01 14:59:59", "2024/10/31 12:00:00", -416.5, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", 4.4, "フブキ");
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (7, 130211, 0.0, 201, 7, 3003201, 3003, "2030/01/01 14:59:59", "2024/10/31 12:00:00", -416.5, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", 0.0, "フブキ");
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (2, 130211, 0.0, 202, 1, 3003202, 3003, "2030/01/01 14:59:59", "2024/10/31 12:00:00", -416.5, "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", 5.6, "フブキ");
